INSERT INTO `extras_help` VALUES (1,'Does match have fake profiles?','According to the Match.com online dating class action, users only learn that the profiles are fake after they pay for a subscription. ... In reality, the messages are allegedly from fake profiles and a ploy to get users to upgrade to paid services.','',10),(2,'Can you get in trouble for making a fake profile?','No, it is no crime to create a fake facebook profile. ... All the same, social media does not account for identity, so using a fake name is no crime. Think it this way, personal verified accounts are not even 10%, so using fake or incomplete data may be really frequent at facebook.','',10);
