y place their subscription on hold&#10;     for up to one year;</span></li>&#10; <li class=\"MsoNormal\"><span>How your information is used&#10;     and how you may access your information is set forth in our&#160;</span><span><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy\" target=\"_blank\"><span>Privacy&#10;     Policy</span></a></span><span>;</span></li>&#10; <li class=\"MsoNormal\"><span>You may review the New York&#10;     Dating Service Consumer Bill of Rights&#160;</span><span><a href=\"https://www.nysenate.gov/legislation/laws/GBS/394-C\" target=\"_blank\"><span>here</span></a></span><span>;</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><u><span>For subscribers&#10;residing in North Carolina:</span></u><span></span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>You may review the North&#10;     Carolina Buyer\'s Rights&#160;</span><span><a href=\"https://www.ncleg.gov/EnactedLegislation/Statutes/PDF/BySection/Chapter_66/GS_66-120.pdf\" target=\"_blank\"><span>here</span></a></span><span>.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><u><span>For subscribers&#10;residing in Illinois, New York, North Carolina, and Ohio :</span></u><span></span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>Our Services are widely&#10;     available in the United States-if you believe that you have moved outside&#10;     a location where we provide the Services, please contact us in writing&#10;     delivered to </span><b><span>TSA Legal, P.O. Box 251111DDF2, HOUSTON,&#10;     Texas 70255,</span></b><span>USA, and we will work with you&#10;     to provide alternative services or a refund.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><u><span>For subscribers&#10;residing in Arizona, California, Connecticut, Illinois, Iowa, Minnesota, New&#10;York, North Carolina, Ohio, Rhode Island, and Wisconsin:</span></u><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>Your Right to&#10;Cancel-You may cancel your subscription, without penalty or obligation, at any&#10;time prior to midnight of the third business day following the date you&#10;subscribed.</span></b><span>&#160;In the event&#10;that you die before the end of your subscription period, your estate shall be&#10;entitled to a refund of that portion of any payment you had made for your&#10;subscription which is allocable to the period after your death. In the event&#10;that you become disabled (such that you are unable to use our Services) before&#10;the end of your subscription period, you shall be entitled to a refund of that&#10;portion of any payment you had made for your subscription which is allocable to&#10;the period after your disability by providing the company notice in the same&#10;manner as you request a refund as described above in Section 8.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>ARBITRATION PROCEDURES</span></p>&#10;&#10;<ol start=\"1\" type=\"1\">&#10; <li class=\"MsoNormal\"><u><span>Overview</span></u><span>. Arbitration is an alternative to litigation where a&#10;     neutral person (the arbitrator) hears and decides the parties\' dispute.&#10;     Arbitration proceedings are designed to provide parties with a fair&#10;     hearing in a manner that is faster and less formal than court proceedings.&#10;     The following procedures (the &#34;Arbitration Procedures&#34;) are&#10;     applicable to all arbitration proceedings involving you and </span><b><span>MEDIA COMPANY</span></b><span></span></li>&#10; <li class=\"MsoNormal\"><u><span>Pre-Arbitration&#10;     Dispute Resolution</span></u><span>.&#10;     </span><b><span>MEDIA&#10;     COMPANY </span></b><span>is always&#10;     interested in resolving disputes amicably and efficiently. So before you&#10;     commence an arbitration, we suggest that you contact us to explain your&#10;     complaint, as we may be able to resolve it without the need for&#10;     arbitration. You may contact us online or at </span><span>&#160;Legal, Address&#10;     here.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Administrator</span></u><span>. The administrator for the arbitration is JAMS, an&#10;     organization that is not affiliated with PeopleMedia. JAMS facilitates,&#10;     but does not itself conduct, the arbitration. The arbitrator who will hear&#10;     and decide your dispute will be chosen from JAMS\'s roster of neutral&#10;     arbitrators. For information on JAMS, please visit its website,&#160;</span><span><a href=\"https://www.jamsadr.com/\" target=\"_blank\"><span>https://www.jamsadr.com/</span></a></span><span>. Information about JAMS\'s rules and fees for resolving&#10;     disputes can be found at JAMS\'s Streamlined Arbitration Rules &amp;&#10;     Procedures page,&#160;</span><span><a href=\"https://www.jamsadr.com/rules-streamlined-arbitration/\" target=\"_blank\"><span>https://www.jamsadr.com/rules-streamlined-arbitration/</span></a></span><span>.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Applicable Rules</span></u><span>. The arbitration will be governed by JAMS\'s&#10;     Streamlined Arbitration Rules &amp; Procedures (the &#34;JAMS&#10;     Rules&#34;), as modified by these Arbitration Procedures. If there is any&#10;     inconsistency between the JAMS Rules and these Arbitration Procedures, the&#10;     Arbitration Procedures will control. However, if the arbitrator determines&#10;     that strict application of the Arbitration Procedures would not result in&#10;     a fundamentally fair arbitration, the arbitrator may make any order&#10;     necessary to provide a fundamentally fair arbitration that is consistent&#10;     with the JAMS Rules.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Commencing an Arbitration</span></u><span>. To commence an arbitration against PeopleMedia, you&#10;     must complete a short form, submit it to JAMS, and send a copy to&#10;     PeopleMedia at Match Legal, PO Box 25458, Dallas, TX 75225. To learn more&#10;     about commencing an arbitration and to obtain a form to institute&#10;     arbitration, please visit the JAMS website and download the form available&#10;     at:&#160;</span><span><a href=\"https://www.jamsadr.com/files/Uploads/Documents/JAMS_Arbitration_Demand.pdf\" target=\"_blank\"><span>https://www.jamsadr.com/files/Uploads/Documents/JAMS_Arbitration_Demand.pdf</span></a></span><span>. You may represent yourself in the arbitration or have&#10;     a lawyer (or some other representative) act on your behalf. Upon receipt&#10;     of an arbitration claim, PeopleMedia may assert any counterclaims it may&#10;     have against the complaining party.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Fees</span></u><span>. You are responsible for paying your portion of the&#10;     fees set forth in the JAMS fee schedule for consumer disputes. </span><b><span>MEDIA COMPANY </span></b><span>will&#10;     pay all remaining fees. If your claim against </span><b><span>MEDIA COMPANY</span></b><span> is for less than $1,000, and you succeed on the&#10;     merits, we will pay all fees. If you believe you cannot afford the JAMS&#10;     fee, you may apply to JAMS for a fee waiver.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Discovery</span></u><span>. Each party may (a) request relevant, non-privileged&#10;     documents from the other party; and (b) request that the other party&#10;     provide the particulars of its claims or defenses. Any such discovery&#10;     requests must be served on the other party within 21 days after the&#10;     arbitrator\'s appointment. The responding party shall provide the&#10;     requesting party with all responsive, non-privileged documents, the&#10;     requested particulars, and/or any objections to the requests within 15&#10;     days after receipt of the requests. Any disputes about discovery or&#10;     requests for extensions shall be submitted promptly to the arbitrator for&#10;     prompt resolution. In ruling on any discovery dispute or extension&#10;     request, the arbitrator shall take into consideration the nature, amount,&#10;     and scope of the underlying arbitration claim, the cost and other effort&#10;     what would be involved in providing the requested discovery, the case&#10;     schedule, and whether the requested discovery is necessary for the&#10;     adequate preparation of a claim or defense.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Communications with the&#10;     Arbitrator</span></u><span>. Whenever communicating with&#10;     the arbitrator, the parties must include each other &#8211; for example, by&#10;     including the other party on a telephone conference call and copying the&#10;     other party on any written submissions, such as letters or emails. To the&#10;     extent practicable, conferences with the arbitrator will take place by&#10;     telephone conference call or email. Ex parte communications are not&#10;     permitted with any arbitrator.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Confidentiality</span></u><span>. Upon either party\'s request, the arbitrator will&#10;     issue an order requiring that confidential information of either party&#10;     disclosed during the arbitration (whether in documents or orally) may not&#10;     be used or disclosed except in connection with the arbitration or a&#10;     proceeding to enforce the arbitration award and that any permitted filing&#10;     of confidential information must be done under seal.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Arbitration Hearing</span></u><span>. The Parties agree to waive an oral Hearing and submit&#10;     the dispute to the Arbitrator for an Award based on written submissions&#10;     and other evidence as the Parties may agree, unless a party requests an&#10;     oral Hearing in writing within 10 days after the arbitrator\'s appointment.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Arbitration Award</span></u><span>. The arbitrator will render a written decision within&#10;     30 days after the hearing or, if no hearing was held, within 14 days after&#10;     any rebuttal or supplemental statements are due. The decision must clearly&#10;     specify the relief, if any, awarded and contain a brief statement of the&#10;     reasons for the award.</span></li>&#10;</ol>&#10;&#10;<p class=\"MsoNormal\"><span>&#160;</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>Click&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/termsandconditions/archive\"><span>here</span></a><span>&#160;to view previous Terms and Conditions.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>&#160;</span></p>&#10;&#10;<h3><span>&#160;</span><u><span>Dating&#10;Safety Tips</span></u></h3>&#10;&#10;<p class=\"MsoNormal\"><span>Meeting new people is exciting, but you should always be&#10;cautious when interacting with someone you don&#8217;t know. Use your best judgment&#10;and put your safety first, whether you are exchanging initial messages or&#10;meeting in person. While you can&#8217;t control the actions of others, there are&#10;things you can do to help you stay safe during you&#8217;re the Single App experience.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><u><span>Online Safety</span></u></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Never Send Money or Share Financial Information</span></b><span><br>&#10;     Never send money, especially over wire transfer, even if the person claims&#10;     to be in an emergency. Wiring money is like sending cash &#8212; it&#8217;s nearly&#10;     impossible to reverse the transaction or trace where the money went. Never&#10;     share information that could be used to access your financial accounts. If&#10;     another user asks you for money, report it to us immediately.<br>&#10;     <br>&#10;     For tips on avoiding romance scams, check out some advice from the U.S&#10;     Federal Trade Commission&#160;</span><span><a href=\"https://www.consumer.ftc.gov/articles/0004-online-dating-scams\"><span>on the FTC website</span></a></span><span>&#160;or in the video below.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\" align=\"center\"><a href=\"https://www.consumer.ftc.gov/articles/0004-online-dating-scams\"><span>https://www.consumer.ftc.gov/articles/0004-online-dating-scams</span></a><span><br>&#10;<br>&#10;<br>&#10;</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Protect Your Personal Information</span></b><span><br>&#10;     Never share personal information, such as your social security number,&#10;     home or work address, or details about your daily routine (e.g., that you&#10;     go to a certain gym every Monday) with people you don&#8217;t know. If you are a&#10;     parent, limit the information that you share about your children on your&#10;     profile and in early communications. Avoid sharing details such as your&#10;     children&#8217;s names, where they go to school, or their ages or genders</span></li>&#10; <li class=\"MsoNormal\"><b><span>Stay on the Platform</span></b><span><br>&#10;     Keep conversations on theThe Single App platform while you&#8217;re getting to&#10;     know someone. Users with bad intentions often try to move the conversation&#10;     to text, messaging apps, email, or phone right away.</span></li>&#10; <li class=\"MsoNormal\"><b><span>Be Wary of Long Distance and Overseas Relationships</span></b><span><br>&#10;     Watch out for scammers who claim to be from your country but stuck&#10;     somewhere else, especially if they ask for financial help to return home.&#10;     Be wary of anyone who will not meet in person or talk on a phone/video&#10;     call&#8212;they may not be who they say they are. If someone is avoiding your&#10;     questions or pushing for a serious relationship without meeting or getting&#10;     to know you first &#8212; that&#8217;s a red flag.</span></li>&#10; <li class=\"MsoNormal\"><b><span>Report All Suspicious and Offensive Behavior</span></b><span><br>&#10;     You know when someone&#8217;s crossed the line and when they do, we want to know&#10;     about it. Block and report anyone that violates our terms. Here are some&#10;     examples of violations:</span></li>&#10; <ul type=\"circle\">&#10;  <li class=\"MsoNormal\"><span>Requests for money or donations</span></li>&#10;  <li class=\"MsoNormal\"><span>Underage users</span></li>&#10;  <li class=\"MsoNormal\"><span>Harassment, threats, and offensive messages</span></li>&#10;  <li class=\"MsoNormal\"><span>Inappropriate or harmful behavior during or after&#10;      meeting in person</span></li>&#10;  <li class=\"MsoNormal\"><span>Fraudulent profiles</span></li>&#10;  <li class=\"MsoNormal\"><span>Spam or solicitation including links to commercial&#10;      websites or attempts to sell products or services</span></li>&#10; </ul>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>You can report any concerns about suspicious behavior from any&#10;profile page or messaging window or&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/help\"><b><span>here</span></b></a><span>.&#10;For more information, check out our&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/guidelines\"><b><span>Community Guidelines</span></b></a><span>.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Protect Your Account</span></b><span><br>&#10;     Be sure to pick a strong password, and always be careful when logging into&#10;     your account from a public or shared computer. BlackPeopleMeet will never&#10;     send you an email asking for your username and password information &#8212; if&#10;     you receive an email asking for account information, report it&#10;     immediately.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><u><span>Meeting in Person</span></u></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Don&#8217;t Be In A Rush</span></b><span><br>&#10;     Take your time and get to know the other person before agreeing to meet or&#10;     chat off The Single App. Don&#8217;t be afraid to ask questions to screen for&#10;     any red flags or personal dealbreakers. A phone or video call can be a&#10;     useful screening tool before meeting.</span></li>&#10; <li class=\"MsoNormal\"><b><span>Meet in Public and Stay in Public</span></b><span><br>&#10;     Meet for the first few times in a populated, public place &#8212; never at your&#10;     home, your date&#8217;s home, or any other private location. If your date&#10;     pressures you to go to a private location, end the date.</span></li>&#10; <li class=\"MsoNormal\"><b><span>Tell Friends and Family About Your Plans</span></b><span><br>&#10;     Tell a friend or family member of your plans, including when and where&#10;     you&#8217;re going. Have your cell phone charged and with you at all times.</span></li>&#10; <li class=\"MsoNormal\"><b><span>Be in Control of Your Transportation</span></b><span><br>&#10;     We want you to be in control of how you get to and from your date so that&#10;     you can leave whenever you want. If you&#8217;re driving yourself, it&#8217;s a good&#10;     idea to have a backup plan such as a ride-share app or a friend to pick&#10;     you up.</span></li>&#10; <li class=\"MsoNormal\"><b><span>Know Your Limits</span></b><span><br>&#10;     Be aware of the effects of drugs or alcohol on you specifically &#8212; they can&#10;     impair your judgment and your alertness. If your date tries to pressure&#10;     you to use drugs or drink more than you&#8217;re comfortable with, hold your&#10;     ground and end the date.</span></li>&#10; <li class=\"MsoNormal\"><b><span>Don&#8217;t Leave Drinks or Personal Items Unattended</span></b><span><br>&#10;     Know where your drink comes from and know where it is at all times &#8212; only&#10;     accept drinks poured or served directly from the bartender or server. Many&#10;     substances that are slipped into drinks to facilitate sexual assault are&#10;     odorless, colorless, and tasteless. Also, keep your phone, purse, wallet,&#10;     and anything containing personal information on you at all times.</span></li>&#10; <li class=\"MsoNormal\"><b><span>If You Feel Uncomfortable, Leave</span></b><span><br>&#10;     It&#8217;s okay to end the date early if you&#8217;re feeling uncomfortable. In fact,&#10;     it&#8217;s encouraged. And if your instincts are telling you something is off or&#10;     you feel unsafe, ask the bartender or server for help.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><u><span>Sexual Health &amp; Consent</span></u></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Protect Yourself</span></b><span><br>&#10;     When used correctly and consistently, condoms can significantly reduce the&#10;     risk of contracting and passing on STI&#8217;s like HIV. But, be aware of STIs&#10;     like herpes or HPV that can be passed on through skin-to-skin contact. The&#10;     risk of contracting some STIs can be reduced through&#160;</span><span><a href=\"http://www.ashasexualhealth.org/stdsstis/vaccines/\"><span>vaccination</span></a></span><span>.</span></li>&#10; <li class=\"MsoNormal\"><b><span>Know Your Status</span></b><span><br>&#10;     Not all STIs show symptoms, and you don&#8217;t want to be in the dark about&#10;     your status. Stay on top of your health and prevent the spread of STIs by&#10;     getting tested regularly. Here&#8217;s where you can&#160;</span><span><a href=\"https://gettested.cdc.gov/\"><span>find a clinic near you</span></a></span><span>&#160;(US only).</span></li>&#10; <li class=\"MsoNormal\"><b><span>Talk About It</span></b><span><br>&#10;     Communication is everything: Before you get physically intimate with a&#10;     partner, talk about sexual health and STI testing. And be aware &#8212; in some&#10;     places, it&#8217;s actually a crime to knowingly pass on an STI. Need help&#10;     starting the conversation?&#160;</span><span><a href=\"https://www.plannedparenthood.org/learn/stds-hiv-safer-sex/get-tested/how-do-i-talk-my-partner-about-std-testing\"><span>Here are some tips</span></a></span><span>.</span></li>&#10; <li class=\"MsoNormal\"><b><span>Consent</span></b><span><br>&#10;     All sexual activity must start with consent and should include ongoing&#10;     check-ins with your partner. Verbal communication can help you and your&#10;     partner ensure that you respect each other&#8217;s boundaries. Consent can be&#10;     withdrawn at any time, and sex is never owed to anyone. Do not proceed if&#10;     your partner seems uncomfortable or unsure, or if your partner is unable&#10;     to consent due to the effects of drugs or alcohol. Read more about&#10;     it&#160;</span><span><a href=\"https://www.rainn.org/articles/what-is-consent\"><span>here</span></a></span><span>.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><u><span>Resources for Help, Support, or Advice</span></u></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>Remember &#8212; even if you follow these tips, no method of risk&#10;reduction is perfect. If you have a negative experience, please know that it is&#10;not your fault and help is available. Report any incidents&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/help\"><b><span>here</span></b></a><span>,&#10;and consider reaching out to one of the resources below.&#160;<b>If you feel&#10;you are in immediate danger or need emergency assistance, call 911 (U.S. or&#10;Canada) or your local law enforcement agency.</b></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>RAINN&#8217;s National Sexual Assault Hotline</span></b><span><br>&#10;1-800-656-HOPE (4673) |&#160;</span><a href=\"https://hotline.rainn.org/online\"><span>online.rainn.org</span></a><span>&#160;|&#160;</span><a href=\"https://www.rainn.org/\"><span>www.rainn.org</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>Planned Parenthood</span></b><span><br>&#10;1-800-230-7526 |&#160;</span><a href=\"https://www.plannedparenthood.org/\"><span>www.plannedparenthood.org</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>National Domestic Violence Hotline</span></b><span><br>&#10;1-800-799-SAFE (7233) or 1-800-787-3224 |&#160;</span><a href=\"https://www.thehotline.org/\"><span>www.thehotline.org</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>National Human Trafficking Hotline</span></b><span><br>&#10;1-888-272-7888 or text 233733 |&#160;</span><a href=\"https://humantraffickinghotline.org/\"><span>www.humantraffickinghotline.org</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>National Sexual Violence Resource Center</span></b><span><br>&#10;1-877-739-3895 |&#160;</span><a href=\"https://www.nsvrc.org/\"><span>www.nsvrc.org</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>National Center for Missing &amp; Exploited Children</span></b><span><br>&#10;1-800-THE-LOST (843-5678) |&#160;</span><a href=\"https://www.missingkids.org/gethelpnow/cybertipline\"><span>www.cybertipline.com</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>Cyber Civil Rights Initiative</span></b><span><br>&#10;1-844-878-2274 |&#160;</span><a href=\"https://www.cybercivilrights.org/\"><span>www.cybercivilrights.org</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>VictimConnect - Crime Victim Resource Center</span></b><span><br>&#10;1-855-4VICTIM (855-484-2856) |&#160;</span><a href=\"https://victimconnect.org/\"><span>www.victimconnect.org</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>FBI Internet Crime Complaint Center</span></b><span><br>&#10;</span><a href=\"https://www.ic3.gov/default.aspx\"><span>www.ic3.gov</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>LGBT National Help Center</span></b><span><br>&#10;1-888-843-4564 |&#160;</span><a href=\"http://www.glbtnationalhelpcenter.org/\"><span>www.glbtnationalhelpcenter.org</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>Trans Lifeline</span></b><span><br>&#10;1-877-565-8860 (US) or 1-877-330-6366 (CA) |&#160;</span><a href=\"https://www.translifeline.org/\"><span>www.translifeline.org</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><span>If you are outside the US:</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span><a href=\"https://mtch.com/safety-details-international\"><span>Click here</span></a></span><span>&#160;for additional resources in many of the countries&#10;     where we operate.</span></li>&#10;</ul>',''),(2,'<p class=\"MsoNormal\"><span>Welcome to </span><span>TheSingleApp.com&#10;</span><span>Privacy Policy. Thank&#10;you for taking the time to read it.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>We appreciate that you&#10;trust us with your information and we intend to always keep that trust. This&#10;starts with making sure you understand the information we collect, why we&#10;collect it, how it is used and your choices regarding your information. This&#10;Policy describes our privacy practices in plain language, keeping legal and&#10;technical jargon to a minimum.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>This Privacy Policy&#10;applies beginning May 25, 2018. The previous version of this Privacy Policy,&#10;available&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy/archive/20161116\"><span>here</span></a><span>, will apply until then.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>EFFECTIVE DATE: May&#10;25, 2018</span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>1.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#WhoWeAre\"><span>WHO WE ARE</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>2.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#WhereThisPrivacyPolicyApplies\"><span>WHERE THIS PRIVACY POLICY APPLIES</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>3.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#InformationWeCollect\"><span>INFORMATION WE COLLECT</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>4.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#CookiesAndOtherSimilarDataCollectionTechnologies\"><span>COOKIES AND OTHER SIMILAR DATA COLLECTION&#10;TECHNOLOGIES</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>5.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowWeUseInformation\"><span>HOW WE USE INFORMATION</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>6.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowWeShareInformation\"><span>HOW WE SHARE INFORMATION</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>7.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#CrossBorderDataTransfers\"><span>CROSS-BORDER DATA TRANSFERS</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>8.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#YourRights\"><span>YOUR RIGHTS</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>9.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#ResidentsOfCalifornia\"><span>RESIDENTS OF CALIFORNIA</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>10.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowWeProtectYourInformation\"><span>HOW WE PROTECT YOUR INFORMATION</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>11.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowLongWeRetainYourInformation\"><span>HOW LONG WE RETAIN YOUR INFORMATION</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>12.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#ChildrensPrivacy\"><span>CHILDREN\'S PRIVACY</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>13.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#PrivacyPolicyChanges\"><span>PRIVACY POLICY CHANGES</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\" align=\"right\"><span>14.</span></p>&#10;&#10;<p class=\"MsoNormal\"><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowToContactUs\"><span>HOW TO CONTACT US</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>1.WHO WE ARE</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>If you live in the&#10;United States or Canada, the company that is responsible for your information&#10;under this Privacy Policy (the &#34;data controller&#34;) is:</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>Media company name and address here.&#160;&#10;</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>2.WHERE THIS PRIVACY POLICY APPLIES</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>This Privacy Policy&#10;applies to websites, apps, events and other services operated by </span><span>TheSingleApp.com&#10;</span><span>For simplicity, we&#10;refer to all of these as our &#34;services&#34; in this Privacy Policy. To&#10;make it extra clear, we\'ve added links to this Privacy Policy on all applicable&#10;services.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>Some services may&#10;require their own unique privacy policy. If a particular service has its own&#10;privacy policy, then that policy -- not this Privacy Policy -- applies.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>3.INFORMATION WE COLLECT</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>It goes without&#10;saying, we can\'t help you develop meaningful connections without some&#10;information about you, such as basic profile details and the types of people&#10;you\'d like to meet. We also collect information generated as you use our&#10;services, for example access logs, as well as information from third parties,&#10;like when you access our services through a social media account. If you want&#10;additional info, we go into more detail below.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>Information you give us</span></i></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>You choose to give us&#10;certain information when using our services. This includes:</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>When you create an account, you&#10;     provide us with at least your login credentials, as well as some basic&#10;     details necessary for the service to work, such as your gender and date of&#10;     birth.</span></li>&#10; <li class=\"MsoNormal\"><span>When you complete your profile,&#10;     you can share with us additional information, such as details on your&#10;     personality, lifestyle, interests and other details about you, as well as&#10;     content such as photos and videos. To add certain content, like pictures&#10;     or videos, you may allow us to access your camera or photo album. Some of&#10;     the information you choose to provide us may be considered&#10;     &#34;special&#34; or &#34;sensitive&#34; in certain jurisdictions, for&#10;     example your racial or ethnic origins, sexual orientation and religious&#10;     beliefs. By choosing to provide this information, you consent to our&#10;     processing of that information.</span></li>&#10; <li class=\"MsoNormal\"><span>When you subscribe to a paid&#10;     service or make a purchase directly from us (rather than through a&#10;     platform such as iOS or Android), you provide us or our payment service&#10;     provider with information, such as your debit or credit card number or&#10;     other financial information.</span></li>&#10; <li class=\"MsoNormal\"><span>When you participate in surveys&#10;     or focus groups, you give us your insights into our products and services,&#10;     responses to our questions and testimonials.</span></li>&#10; <li class=\"MsoNormal\"><span>When you choose to participate&#10;     in our promotions, events or contests, we collect the information that you&#10;     use to register or enter.</span></li>&#10; <li class=\"MsoNormal\"><span>If you contact our customer&#10;     care team, we collect the information you give us during the interaction.&#10;     Sometimes, we monitor or record these interactions for training purposes&#10;     and to ensure a high quality of service.</span></li>&#10; <li class=\"MsoNormal\"><span>If you ask us to communicate&#10;     with or otherwise process information of other people (for example, if you&#10;     ask us to send an email on your behalf to one of your friends), we collect&#10;     the information about others that you give us in order to complete your&#10;     request.</span></li>&#10; <li class=\"MsoNormal\"><span>Of course, we also process your&#10;     chats with other users as well as the content you publish, as part of the&#10;     operation of the services.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>Information we receive from others</span></i></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>In addition to the&#10;information you provide us directly, we receive information about you from&#10;others, including:</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Other&#10;     Users</span></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>Other users may provide information about you as they use our&#10;services. For instance, we may collect information about you from other users&#10;if they contact us about you.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Social&#10;     Media</span></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>You may be able to use your social media login (such as Facebook&#10;Login) to create and log into your </span><span>TheSingleApp.com </span><span>account. This saves you from having to&#10;remember yet another user name and password and allows you to share some&#10;information from your social media account with us.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Other&#10;     Partners</span></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We may receive info about you from our partners, for instance&#10;when BlackPeopleMeet.com accounts can be created through a partner\'s websites&#10;(in which case they pass along registration information to us) or where </span><span>TheSingleApp.com&#10;</span><span>ads are published on a&#10;partner\'s websites and platforms (in which case they may pass along details on&#10;a campaign\'s success).</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>Information collected when you use our&#10;services</span></i></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>When you use our&#10;services, we collect information about which features you\'ve used, how you\'ve&#10;used them and the devices you use to access our services. See below for more&#10;details:</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Usage&#10;     Information</span></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We collect information about your activity on our services, for&#10;instance how you use them (e.g., date and time you logged in, features you\'ve&#10;been using, searches, clicks and pages which have been shown to you, referring&#10;webpage address, advertising that you click on) and how you interact with other&#10;users (e.g., users you connect and interact with, time and date of your&#10;exchanges, number of messages you send and receive).</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><span>Device&#10;     Information</span></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We collect information from and about the device(s) you use to&#10;access our services, including:</span></p>&#10;&#10;<ul type=\"disc\">&#10; <ul type=\"circle\">&#10;  <li class=\"MsoNormal\"><span>hardware and software&#10;      information such as IP address, device ID and type, device-specific and&#10;      apps settings and characteristics, app crashes, advertising IDs (such as&#10;      Google\'s AAID and Apple\'s IDFA, both of which are randomly generated&#10;      numbers that you can reset by going into your device\' settings), browser&#10;      type, version and language, operating system, time zones, identifiers&#10;      associated with cookies or other technologies that may uniquely identify&#10;      your device or browser (e.g., IMEI/UDID and MAC address);</span></li>&#10;  <li class=\"MsoNormal\"><span>information on your wireless&#10;      and mobile network connection, like your service provider and signal&#10;      strength;</span></li>&#10;  <li class=\"MsoNormal\"><span>information on device sensors&#10;      such as accelerometers, gyroscopes and compasses.</span></li>&#10; </ul>&#10; <li class=\"MsoNormal\"><b><span>Other&#10;     information with your consent</span></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>If you give us permission, we can collect your precise&#10;geolocation (latitude and longitude) through various means, depending on the&#10;service and device you\'re using, including GPS, Bluetooth or Wi-Fi connections.&#10;The collection of your geolocation may occur in the background even when you&#10;aren\'t using the services if the permission you gave us expressly permits such&#10;collection. If you decline permission for us to collect your geolocation, we&#10;will not collect it.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>Similarly, if you consent, we may collect your photos and videos&#10;(for instance, if you want to publish a photo, video or streaming on the&#10;services).</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>4.COOKIES AND OTHER SIMILAR DATA COLLECTION&#10;TECHNOLOGIES</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>We use and may allow&#10;others to use cookies and similar technologies (e.g., web beacons, pixels) to&#10;recognize you and/or your device(s). You may read our&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/cookiepolicy\"><span>Cookie Policy</span></a><span>&#160;for more information on why we use them (such as&#10;authenticating you, remembering your preferences and settings, analyzing site&#10;traffic and trends, delivering and measuring the effectiveness of advertising&#10;campaigns, allowing you to use social features) and how you can better control&#10;their use, through your browser settings and other tools.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>Some web browsers&#10;(including Safari, Internet Explorer, Firefox and Chrome) have a &#34;Do Not&#10;Track&#34; (&#34;<b>DNT</b>&#34;) feature that tells a website that a user&#10;does not want to have his or her online activity tracked. If a website that&#10;responds to a DNT signal receives a DNT signal, the browser can block that&#10;website from collecting certain information about the browser\'s user. Not all&#10;browsers offer a DNT option and DNT signals are not yet uniform. For this&#10;reason, many businesses, including BlackPeopleMeet.com, do not currently&#10;respond to DNT signals.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>5.HOW WE USE INFORMATION</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>The main reason we use&#10;your information is to deliver and improve our services. Additionally, we use&#10;your info to help keep you safe and to provide you with advertising that may be&#10;of interest to you. Read on for a more detailed explanation of the various&#10;reasons we use your information, together with practical examples.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>To administer your account and provide our&#10;services to you</span></i></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>Create and manage your account</span></li>&#10; <li class=\"MsoNormal\"><span>Provide you with customer&#10;     support and respond to your requests</span></li>&#10; <li class=\"MsoNormal\"><span>Complete your transactions</span></li>&#10; <li class=\"MsoNormal\"><span>Communicate with you about our&#10;     services, including order management and billing</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>To help you connect with other users</span></i></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>Analyze your profile and that&#10;     of other users to recommend meaningful connections</span></li>&#10; <li class=\"MsoNormal\"><span>Show users\' profiles to one another</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>To ensure a consistent experience across your&#10;devices</span></i></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>Link the various devices you&#10;     use so that you can enjoy a consistent experience of our services on all&#10;     of them. We do this by linking devices and browser data, such as when you&#10;     log into your account on different devices or by using partial or full IP&#10;     address, browser version and similar data about your devices to help&#10;     identify and link them.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>To serve you relevant offers and ads</span></i></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>Administer sweepstakes,&#10;     contests, discounts or other offers</span></li>&#10; <li class=\"MsoNormal\"><span>Develop, display and track&#10;     content and advertising tailored to your interests on our services and&#10;     other sites</span></li>&#10; <li class=\"MsoNormal\"><span>Communicate with you by email,&#10;     phone, social media or mobile device about products or services that we&#10;     think may interest you</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>To improve our services and develop new ones</span></i></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>Administer focus groups and&#10;     surveys</span></li>&#10; <li class=\"MsoNormal\"><span>Conduct research and analysis&#10;     of users\' behavior to improve our services and content (for instance, we&#10;     may decide to change the look and feel or even substantially modify a&#10;     given feature based on users\' behavior)</span></li>&#10; <li class=\"MsoNormal\"><span>Develop new features and&#10;     services (for example, we may decide to build a new interests-based&#10;     feature further to requests received from users).</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>To prevent, detect and fight fraud or other&#10;illegal or unauthorized activities</span></i></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>Address ongoing or alleged&#10;     misbehavior on and off-platform</span></li>&#10; <li class=\"MsoNormal\"><span>Perform data analysis to better&#10;     understand and design countermeasures against these activities</span></li>&#10; <li class=\"MsoNormal\"><span>Retain data related to&#10;     fraudulent activities to prevent against recurrences</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><i><span>To ensure legal compliance</span></i></b></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><span>Comply with legal requirements</span></li>&#10; <li class=\"MsoNormal\"><span>Assist law enforcement</span></li>&#10; <li class=\"MsoNormal\"><span>Enforce or exercise our rights,&#10;     for example our Terms</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>To process your&#10;information as described above, we rely on the following legal bases:</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><i><span>Provide our service to you:</span></i><span>&#160;Most of the time, the reason we process your&#10;     information is to perform the contract that you have with us. For&#10;     instance, as you go about using our service to build meaningful&#10;     connections, we use your information to maintain your account and your&#10;     profile, to make it viewable to other users and recommend other users to&#10;     you.</span></li>&#10; <li class=\"MsoNormal\"><i><span>Legitimate interests:</span></i><span>&#160;We may use your information where we have&#10;     legitimate interests to do so. For instance, we analyze users\' behavior on&#10;     our services to continuously improve our offerings, we suggest offers we&#10;     think might interest you, and we process information for administrative,&#10;     fraud detection and other legal purposes.</span></li>&#10; <li class=\"MsoNormal\"><i><span>Consent:</span></i><span>&#160;From time to time, we may ask for your consent to&#10;     use your information for certain specific reasons. You may withdraw your&#10;     consent at any time by contacting us at the address provided at the end of&#10;     this Privacy Policy.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><span>6.HOW WE SHARE INFORMATION</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>Since our goal is to&#10;help you make meaningful connections, the main sharing of users\' information&#10;is, of course, with other users. We also share some users\' information with service&#10;providers and partners who assist us in operating the services, with other&#10;Match Group companies and, in some cases, legal authorities. Read on for more&#10;details about how your information is shared with others.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><i><span>With&#10;     other users</span></i></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>You share information with other users when you voluntarily&#10;disclose information on the service (including your public profile). Please be&#10;careful with your information and make sure that the content you share is stuff&#10;that you\'re comfortable being publically viewable since neither you nor we can&#10;control what others do with your information once you share it.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>If you choose to limit the audience for all or part of your&#10;profile or for certain content or information about you, then it will be&#10;visible according to your settings.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><i><span>With&#10;     our service providers and partners</span></i></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We use third parties to help us operate and improve our&#10;services. These third parties assist us with various tasks, including data&#10;hosting and maintenance, analytics, customer care, marketing, advertising,&#10;payment processing and security operations.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>We may also share information with partners who distribute and&#10;assist us in advertising our services. For instance, we may share limited&#10;information on you in hashed, non-human readable form to advertising partners.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>We follow a strict vetting process prior to engaging any service&#10;provider or working with any partner. All of our service providers and partners&#10;must agree to strict confidentiality obligations.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><i><span>With&#10;     other legal Group businesses</span></i></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>TheSingleApp.com </span><span>is part of the Match Group family of&#10;businesses which, as of the date of this Privacy Policy, includes websites and&#10;apps such as Tinder, OkCupid, Plenty of Fish, Match, Meetic, BlackPeopleMeet,&#10;LoveScout24, OurTime, Pairs, ParPerfeito, and Twoo (for more details,&#10;click&#160;</span><a href=\"http://www.mtch.com/\" target=\"_blank\"><span>here</span></a><span>).</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>We share your information with other Match Group companies to&#10;benefit you in two respects:</span></p>&#10;&#10;<ul type=\"disc\">&#10; <ul type=\"circle\">&#10;  <li class=\"MsoNormal\"><span>for other Match Group&#10;      companies to assist us in processing your information, as service&#10;      providers, upon our instructions and on our behalf. Assistance provided&#10;      by other Match Group companies may include technical processing&#10;      operations, such as data hosting and maintenance, customer care,&#10;      marketing and targeted advertising, finance and accounting assistance,&#10;      better understanding how our service is used and users\' behavior to&#10;      improve our service, securing our data and systems and fighting against&#10;      spam, abuse, fraud, infringement and other wrongdoings.</span></li>&#10;  <li class=\"MsoNormal\"><span>In order to improve your&#10;      chances at building significant connections with others, we may make you&#10;      visible on other Match Group services or allow you to benefit from&#10;      cross-platform functionalities. We will of course comply with applicable&#10;      law and, where relevant, notify you of any such opportunity and allow you&#10;      to agree or to refuse. Examples of such opportunities may include the&#10;      creation of a new service within Match Group, addressing a specific&#10;      demographic that we feel would be interesting to you based on your search&#10;      criteria.</span></li>&#10; </ul>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We may also share information with other Match Group companies&#10;for legitimate business purposes such as corporate audit, analysis and&#10;consolidated reporting as well as compliance with applicable laws. We may also&#10;share user information with other Match Group companies to remove users who&#10;violate our terms of service, or have been reported for criminal activity&#10;and/or bad behavior. In some instances, we may remove that user from all&#10;platforms.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><i><span>For&#10;     corporate transactions</span></i></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We may transfer your information if we are involved, whether in&#10;whole or in part, in a merger, sale, acquisition, divestiture, restructuring,&#10;reorganization, dissolution, bankruptcy or other change of ownership or&#10;control.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><i><span>When&#10;     required by law</span></i></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We may disclose your information if reasonably necessary: (i) to&#10;comply with a legal process, such as a court order, subpoena or search warrant,&#10;government / law enforcement investigation or other legal requirements; (ii) to&#10;assist in the prevention or detection of crime (subject in each case to&#10;applicable law); or (iii) to protect the safety of any person.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><i><span>To&#10;     enforce legal rights</span></i></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We may also share information: (i) if disclosure would mitigate&#10;our liability in an actual or threatened lawsuit; (ii) as necessary to protect&#10;our legal rights and legal rights of our users, business partners or other&#10;interested parties; (iii) to enforce our agreements with you; and (iv) to&#10;investigate, prevent, or take other action regarding illegal activity, suspected&#10;fraud or other wrongdoing.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><b><i><span>With&#10;     your consent or at your request</span></i></b></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We may ask for your consent to share your information with third&#10;parties. In any such case, we will make it clear why we want to share the&#10;information.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>We may use and share&#10;non-personal information (meaning information that, by itself, does not&#10;identify who you are such as device information, general demographics, general&#10;behavioral data, geolocation in de-identified form), as well as personal&#10;information in hashed, non-human readable form, under any of the above&#10;circumstances. We may also share this information with other Match Group&#10;companies and third parties (notably advertisers) to develop and deliver&#10;targeted advertising on our services and on websites or applications of third&#10;parties, and to analyze and report on advertising you see. We may combine this&#10;information with additional non-personal information or personal information in&#10;hashed, non-human readable form collected from other sources. More information&#10;on our use of cookies and similar technologies can be found in our&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/cookiepolicy\"><span>Cookie Policy</span></a><span>.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>7.CROSS-BORDER DATA TRANSFERS</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>Sharing of information&#10;laid out in&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowWeShareInformation\"><span>Section 6</span></a><span>&#160;sometimes involves cross-border data transfers, for&#10;instance to the United States of America and other jurisdictions. As an&#10;example, where the service allows for users to be located in the European&#10;Economic Area (&#34;EEA&#34;), their personal information is transferred to&#10;countries outside of the EEA. We use standard contract clauses approved by the&#10;European Commission or other suitable safeguard to permit data transfers from&#10;the EEA to other countries. Standard contractual clauses are commitments&#10;between companies transferring personal data, binding them to protect the&#10;privacy and security of your data.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>8.YOUR RIGHTS</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>We want you to be in&#10;control of your information, so we have provided you with the following tools:</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><u><span>Access / Update tools in the&#10;     service.</span></u><span>&#160;Tools and account&#10;     settings that help you to access, rectify or delete information that you&#10;     provided to us and that\'s associated with your account directly within the&#10;     service. If you have any question on those tools and settings, please&#10;     contact our customer care team for help&#160;</span><span><a href=\"https://peoplemedia.custhelp.com/ci/pta/login/redirect/ask/theme/blackpeoplemeetv6/src/www.blackpeoplemeet.com_v3_help_iframehelper/pmsite/2/p_li/IL6iNIDCslL2vEaS2TbFtIx1I0TMd7TqpbwjMzdcGsKj3L8YlFwvzo_18Q1YNe5ViCYqjE2KZTanjBqR_HvNMnZbWeIeQUtXaFpL1gX_8dJ15iUDULXTGPON61LXP1_eT4WOcZ1vcNSZfmd8alJ6IPUOgoOs_N7Fj14em9F9Hi0lKqd_j6HGM3aZeJipaHRUzuS82Tuz7mHuyB_cuiycawzN_X6yKfI10Zz~44IjQ8TMqS_QzmeKckY0qIfir54qwMMJdM0hUaUTQP_XG7IC7KStf6EnGJVReMONTHNz3mJDBEzdWW6NZC~HVSwKKUrlr2fp0aV9sdQWNqXkxuO4VqUJFVOPZxtHzpg53VV18oEXrClROBekGhT3ItepJjja7IJKrRcAUUwvcgrnJzQ~A89AF1Kwcc25AFO_6lIPNVPojV4XSHLhhaMRo5ICNhgW\" target=\"_blank\"><span>here</span></a></span><span>.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Device permissions.</span></u><span>&#160;Mobile platforms have permission systems for&#10;     specific types of device data and notifications, such as phone book and&#10;     location services as well as push notifications. You can change your&#10;     settings on your device to either consent or oppose the collection of the&#10;     corresponding information or the display of the corresponding&#10;     notifications. Of course, if you do that, certain services may lose full&#10;     functionality.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Deletion.</span></u><span>&#160;You can delete your account by using the&#10;     corresponding functionality directly on the service.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>We want you to be&#10;aware of your privacy rights. Here are a few key points to remember:</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><u><span>Reviewing your information.</span></u><span>&#160;Applicable privacy laws may give you the right to&#10;     review the personal information we keep about you (depending on the&#10;     jurisdiction, this may be called right of access, right of portability or&#10;     variations of those terms). You can request a copy of your personal&#10;     information by putting in such a request&#160;</span><span><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowToContactUs\"><span>here</span></a></span><span>.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Updating your information.</span></u><span>&#160;If you believe that the information we hold about&#10;     you is inaccurate or that we are no longer entitled to use it and want to&#10;     request its rectification, deletion or object to its processing, please&#10;     contact us&#160;</span><span><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowToContactUs\"><span>here</span></a></span><span>.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><span>For your protection&#10;and the protection of all of our users, we may ask you to provide proof of&#10;identity before we can answer the above requests.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>Keep in mind, we may&#10;reject requests for certain reasons, including if the request is unlawful or if&#10;it may infringe on trade secrets or intellectual property or the privacy of&#10;another user. If you wish to receive information relating to another user, such&#10;as a copy of any messages you received from him or her through our service, the&#10;other user will have to contact our Privacy Officer to provide their written&#10;consent before the information is released.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>Also, we may not be&#10;able to accommodate certain requests to object to the processing of personal&#10;information, notably where such requests would not allow us to provide our&#10;service to you anymore. For instance, we cannot provide our service if we do&#10;not have your date of birth.</span></p>&#10;&#10;<ul type=\"disc\">&#10; <li class=\"MsoNormal\"><u><span>Uninstall.</span></u><span>&#160;You can stop all information collection by an app&#10;     by uninstalling it using the standard uninstall process for your device.&#10;     If you uninstall the app from your mobile device, the unique identifier&#10;     associated with your device will continue to be stored. If you re-install&#10;     the application on the same mobile device, we will be able to re-associate&#10;     this identifier to your previous transactions and activities.</span></li>&#10; <li class=\"MsoNormal\"><u><span>Accountability.</span></u><span>&#160;In certain countries, including in the European&#10;     Union, you have a right to lodge a complaint with the appropriate data&#10;     protection authority if you have concerns about how we process your&#10;     personal information. The data protection authority you can lodge a&#10;     complaint with notably may be that of your habitual residence, where you&#10;     work or where we are established.</span></li>&#10;</ul>&#10;&#10;<p class=\"MsoNormal\"><b><span>9.RESIDENTS OF CALIFORNIA</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>If you are a&#10;California resident, you can request a notice disclosing the categories of&#10;personal information about you that we have shared with third parties for their&#10;direct marketing purposes during the preceding calendar year. To request this&#10;notice, please submit your request&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowToContactUs\"><span>here</span></a><span>. Please allow 30 days for a response. For your protection and&#10;the protection of all of our users, we may ask you to provide proof of identity&#10;before we can answer such a request.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>10.HOW WE PROTECT YOUR INFORMATION</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>We work hard to&#10;protect you from unauthorized access to or alteration, disclosure or&#10;destruction of your personal information. As with all technology companies,&#10;although we take steps to secure your information, we do not promise, and you&#10;should not expect, that your personal information will always remain secure.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>We regularly monitor&#10;our systems for possible vulnerabilities and attacks and regularly review our&#10;information collection, storage and processing practices to update our&#10;physical, technical and organizational security measures.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>We may suspend your&#10;use of all or part of the services without notice if we suspect or detect any&#10;breach of security. If you believe that your account or information is no&#10;longer secure, please notify us immediately&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowToContactUs\"><span>here</span></a><span>.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>11.HOW LONG WE RETAIN YOUR INFORMATION</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>We keep your personal&#10;information only as long as we need it for legitimate business purposes (as laid&#10;out in&#160;</span><a href=\"https://www.blackpeoplemeet.com/v3/privacypolicy#HowWeUseInformation\"><span>Section 5</span></a><span>) and as permitted by applicable law.</span></p>&#10;&#10;<p class=\"MsoNormal\"><span>In practice, we delete&#10;or anonymize your information upon deletion of your account, unless:</span></p>&#10;&#10;<ol start=\"1\" type=\"1\">&#10; <li class=\"MsoNormal\"><span>we must keep it to comply with&#10;     applicable law;</span></li>&#10; <li class=\"MsoNormal\"><span>we must keep it to evidence our&#10;     compliance with applicable law;</span></li>&#10; <li class=\"MsoNormal\"><span>there is an outstanding issue,&#10;     claim or dispute requiring us to keep the relevant information until it is&#10;     resolved; or</span></li>&#10; <li class=\"MsoNormal\"><span>the information must be kept&#10;     for our legitimate business interests, such as fraud prevention and&#10;     enhancing users\' safety and security. For example, information may need to&#10;     be kept to prevent a user who was banned for unsafe behavior or security&#10;     incidents from opening a new account.</span></li>&#10;</ol>&#10;&#10;<p class=\"MsoNormal\"><span>Keep in mind that even&#10;though our systems are designed to carry out data deletion processes according&#10;to the above guidelines, we cannot promise that all data will be deleted within&#10;a specific timeframe due to technical constraints.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>12.CHILDREN\'S PRIVACY</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>Our services are restricted&#10;to users who are 18 years of age or older. We do not permit users under the age&#10;of 18 on our platform and we do not knowingly collect personal information from&#10;anyone under the age of 18. If you suspect that a user is under the age of 18,&#10;please use the reporting mechanism available through the service.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>13.PRIVACY POLICY CHANGES</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>Because we\'re always&#10;looking for new and innovative ways to help you build meaningful connections,&#10;this policy may change over time. We will notify you before any material&#10;changes take effect so that you have time to review the changes.</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>14.HOW TO CONTACT US</span></b></p>&#10;&#10;<p class=\"MsoNormal\"><span>If you have questions&#10;about this Privacy Policy, here\'s how you can reach us:</span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>Online:</span></b><span>&#160;</span><a href=\"https://peoplemedia.custhelp.com/ci/pta/login/redirect/ask/theme/blackpeoplemeetv6/src/www.blackpeoplemeet.com_v3_help_iframehelper/pmsite/2/p_li/IL6iNIDCslL2vEaS2TbFtIx1I0TMd7TqpbwjMzdcGsKj3L8YlFwvzo_18Q1YNe5ViCYqjE2KZTanjBqR_HvNMnZbWeIeQUtXaFpL1gX_8dJ15iUDULXTGPON61LXP1_eT4WOcZ1vcNSZfmd8alJ6IPUOgoOs_N7Fj14em9F9Hi0lKqd_j6HGM3aZeJipaHRUzuS82Tuz7mHuyB_cuiycawzN_X6yKfI10Zz~44IjQ8TMqS_QzmeKckY0qIfir54qwMMJdM0hUaUTQP_XG7IC7KStf6EnGJVReMONTHNz3mJDBEzdWW6NZC~HVSwKKUrlr2fp0aV9sdQWNqXkxuO4VqUJFVOPZxtHzpg53VV18oEXrClROBekGhT3ItepJjja7IJKrRcAUUwvcgrnJzQ~A89AF1Kwcc25AFO_6lIPNVPojV4XSHLhhaMRo5ICNhgW\" target=\"_blank\"><span>here</span></a><span></span></p>&#10;&#10;<p class=\"MsoNormal\"><b><span>By Post:</span></b><span><br>&#10;Privacy Officer<br>&#10;meadia group address and name here</span></p>',''),(3,'value',''),(4,'value',''),(5,'value',''),(6,'value',''),(7,'value','');
